private Cluster createCluster(String labelBase, Document... documents) {
	Cluster cluster = new Cluster();
	for (int i = 0; i < labels; i++) {
		cluster.addPhrases(labelBase + "#" + (i + 1));
	}
	cluster.addDocuments(documents);
	return cluster;
}

